// * Mysql 데이터베이스는 기본적으로 설치되어 있어야한다.
// Mysql 데이터베이스 설치 쿼리 : CREATE DATABASE "db_name"

// TODO
// ! 재설치 및 패치기능은 현재까지 칼럼까지만 검사를 수행한다.
// 나중에 관련하여 내부 요소까지 검사를 수행할 수 있도록 한다.

// DISCUSSION 1
// config 파일을 클래스 내부에서 호출할 것인가 클래스 외부에서 호출할 것인가
